import React, { Component } from 'react';
import Countdown from 'react-countdown-now';
import './App.css';

class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      days: '',
      hours: '',
      minutes: '',
      seconds: '00',
    }
  }

  render() {
    return (
      <div className="App">
        <Countdown date={Date.now() + 10000} />
      </div>
    );
  }
}

export default App;
